import './style.css';
import React from 'react';
import {Grid, IconButton} from '@mui/material';
import RecordsCount from '../Manage/RecordsCount';
import LoadDataModal from '../Manage/LoadDataModal';
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';
import { useParams, useLocation, useNavigate } from "react-router-dom";
import WhiteContainer from '../../components/WhiteContainer/WhiteContainer';


function SystemPage(props) {
    const { id } = useParams();
    const {state} = useLocation();
    const navigate = useNavigate();

    return (
        <div>
            <Grid container spacing={3}>
                <Grid item xs={12}>
                    <WhiteContainer>
                        <div className='back-btn-container'>
                            <IconButton onClick={() => navigate(-1)}>
                                <ArrowForwardIcon/>
                            </IconButton>
                        </div>
                        <div className='lead-title-container'>
                            <div className='lead-title'>{`מערכת ${state.name}`}</div>
                        </div>
                    </WhiteContainer>
                </Grid>
                <Grid item xs={12} sm={6}>
                    <WhiteContainer style={{minHeight : '60vh', maxHeight : '60vh', overflow : 'auto'}}>
                        <Grid container spacing={2}>
                        <Grid item xs={6}>
                                <RecordsCount systemId={id}/>
                            </Grid>
                            <Grid item xs={6}>
                                <RecordsCount systemId={id}/>
                            </Grid>
                            <Grid item xs={12}>
                                תותח
                            </Grid>
                        </Grid>
                    </WhiteContainer>
                </Grid>
                <Grid item xs={12} sm={6}>
                <WhiteContainer style={{minHeight : '60vh', maxHeight : '60vh', overflow : 'auto'}}>
                    סטטיסטיקות
                </WhiteContainer>
                </Grid>
            </Grid>
            <LoadDataModal/>
        </div>
    );
}

export default SystemPage;
